  <div>
    <div className="sideBarBox">
        <h3>Search</h3>
        <Search className="seachBarMain"/>
        <h3>Friends</h3>
    </div>

    <style jsx>{`
    .searchBarMain{
      position:fixed;
      
    }
    .sideBarBox{
    padding: 0;
    margin: 0;
    height: 100vh;
    color: #1DB954;
    background: black;
    position: fixed;
    width: 25%;
  }
    `}
    </style>
  </div>
);

